import gulp from 'gulp';
import sass from 'gulp-sass';
import changed from 'gulp-changed';
import imagemin from 'gulp-imagemin';
import pngquant from 'imagemin-pngquant';
import gulpWebpack from 'webpack-stream';
import webpack from 'webpack';
import plumber from 'gulp-plumber';
import browserSync from 'browser-sync';
import webpackConfig from './webpack.config';

const dist = './dist'; // 出力先

// FIXME gulp.taskのタスク定義のやり方は古いらしい

// 圧縮前と圧縮後のディレクトリを定義
const paths = {
  srcDir: 'src',
  dstDir: dist,
};

// sassをコンパイルしてcss圧縮
gulp.task('sass', () => {
  return gulp
    .src('./src/assets/sass/*.sass', {
      sourcemaps: true,
    })
    .pipe(plumber())
    .pipe(sass({ outputStyle: 'compressed' })) // 圧縮
    .pipe(autoprefixer(['last 3 versions', 'ie >= 8', 'Android >= 4', 'iOS >= 8']))
    .pipe(
      gulp.dest(dist + '/css', {
        sourcemaps: true,
      })
    )
    .pipe(browserSync.stream());
});

gulp.task('bendor', () => {
  return gulp
    .src('src/assets/castyle.css')
    .pipe(
      postcss([
        autoprefixer({
          // ☆IEは11以上、Androidは4.4以上
          // その他は最新2バージョンで必要なベンダープレフィックスを付与する設定
          browsers: ['last 2 versions', 'ie >= 11', 'Android >= 4'],
          cascade: false,
        }),
      ])
    )
    .pipe(gulp.dest('dist'));
});

// いろんな拡張子を圧縮するためのオプション
const imageminOption = [
  pngquant({ quality: [0.65, 0.8] }),
  pngquant({ quality: 85 }),
  imagemin.gifsicle({
    interlaced: false,
    optimizationLevel: 1,
    colors: 256,
  }),
  imagemin.optipng(),
  imagemin.svgo(),
];

// 画像圧縮
gulp.task('imagemin', () => {
  const srcGlob = paths.srcDir + '/assets/img/*.+(jpg|jpeg|png|gif|svg)'; // 元画像
  const dstGlob = paths.dstDir; // 圧縮先
  return gulp
    .src(srcGlob)
    .pipe(plumber())
    .pipe(changed(dstGlob)) //差分のみ圧縮
    .pipe(imagemin(imageminOption))
    .pipe(gulp.dest(dstGlob));
});

gulp.task('webpack', () => {
  return gulpWebpack(webpackConfig, webpack)
    .pipe(plumber())
    .pipe(gulp.dest(dist + '/assets/js'));
});

gulp.task('watch', () => {
  gulp.watch('./src/assets/sass/*.sass', gulp.task('sass'));
  gulp.watch('./src/index.html').on('change', browserSync.reload);
  done();
});

gulp.task('serve', () => {
  return browserSync.init({
    server: './dist',
  });
});

// webpack追加
gulp.task(
  'default',
  gulp.series('sass', 'imagemin', 'webpack', 'serve', 'watch', function (done) {
    done();
  })
);

